def factors_of_factorial(N: int) -> int:
    if N <= 1:
        return 1

    def cal_ways(n: int, p: int) -> int:
        j = p
        c = 0
        while n // j > 0:
            c += n // j
            j *= p
        return c + 1
    t = N
    N = N + 1
    r = 1
    prime = [1] * N
    prime[0] = 0
    prime[1] = 0
    for i in range(2, int(N ** 0.5) + 1):
        j = 2
        while j * i < N:
            prime[j * i] = 0
            j += 1
    for i in range(len(prime)):
        if prime[i] == 1:
            r *= cal_ways(t, i)
    return r

